import React, { PureComponent } from 'react';
import {
  ComposedChart, Line, Area, Bar, XAxis, YAxis, CartesianGrid, Tooltip,
  Legend, Scatter,
} from 'recharts';

const data = [
  {
    name: '9/1', uv: 590, pv: 800, amt: 1400, cnt: 490,
  },
  {
    name: '9/8', uv: 868, pv: 967, amt: 1506, cnt: 590,
  },
  {
    name: '9/15', uv: 1397, pv: 1098, amt: 989, cnt: 350,
  },
  {
    name: '9/22', uv: 1480, pv: 1200, amt: 1228, cnt: 480,
  },
  {
    name: '9/29', uv: 1520, pv: 1108, amt: 1100, cnt: 460,
  },
  {
    name: '10/6', uv: 1400, pv: 680, amt: 1700, cnt: 380,
  },
];

export default class Example extends PureComponent {

  render() {
    return (
      <ComposedChart
        width={500}
        height={400}
        data={data}
        stackOffset="sign"
        margin={{
          top: 20, right: 20, bottom: 20, left: 20,
        }}
      >
        <CartesianGrid stroke="#f5f5f5" />
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        <Legend />
        <Area type="monotone" dataKey="amt" fill="#8884d8" stroke="#8884d8" />
        <Bar dataKey="pv" barSize={20} stackId="a" fill="#413ea0" />
        <Bar dataKey="uv" barSize={20} stackId="a" stroke="#ff7300" />
        {/* <Scatter dataKey="cnt" fill="red" /> */}
      </ComposedChart>
    );
  }
}
